Same thing with any versioned package.. Looking through the code, and how the plist files are named, I am guessing the issue is that the version numbers are dotted, which breaks assumptions in this code.
Consider what happens with a normal plist name -- e.g. homebrew.mxcl.redis.plist -- here:
```objective-c
NSArray *pathComponents = [plistFile componentsSeparatedByString:@"/"];
// ["", "Users", "jon", "Library", "LaunchAgents", "homebrew.mxcl.redis.plist"]
NSArray *filenameComponents = [[pathComponents lastObject] componentsSeparatedByString:@"."];
// ["homebrew", "mxcl", "redis", "plist"]
NSString *serviceName = [[filenameComponents objectAtIndex:[filenameComponents count] - 2] capitalizedString];
// "redis"
```
But!  Consider what happens with a versioned plist name, like homebrew.mxcl.postgresql@9.6.plist:
```objective-c
NSArray *pathComponents = [plistFile componentsSeparatedByString:@"/"];
// ["", "Users", "jon", "Library", "LaunchAgents", "homebrew.mxcl.postgresql@9.6.plist"]
NSArray *filenameComponents = [[pathComponents lastObject] componentsSeparatedByString:@"."];
// ["homebrew", "mxcl", "postgresql@9", "6", "plist"]
NSString *serviceName = [[filenameComponents objectAtIndex:[filenameComponents count] - 2] capitalizedString];
// "6"
```
I haven't touched Objective-C in ages so I'm roughing this out in a Playground using Swift so some translation back to Obj-C would be needed, but perhaps something like this would work:
swift
var serviceName = filenameComponents[2..<(filenameComponents.count - 1)].joined(separator: ".").capitalized
My playground, for those who want to validate this approach:
```swift
import Cocoa
var str = "/Users/jon/Library/LaunchAgents/homebrew.mxcl.postgresql@9.6.plist"
//var str = "/Users/jon/Library/LaunchAgents/homebrew.mxcl.redis.plist"
var pathComponents = str.components(separatedBy: "/")
var filenameComponents = pathComponents.last!.components(separatedBy: ".")
var serviceName = filenameComponents[2..<(filenameComponents.count - 1)].joined(separator: ".").capitalized
// "Postgresql@9.6"
```
Of course if you wanted to omit the version number, you just need to split on @ then get the first element:
swift
var serviceName = filenameComponents[2..<(filenameComponents.count - 1)].joined(separator: ".").capitalized.components(separatedBy: "@")[0]
// "Postgresql"
